window.bookSummaryJSON = "<p>A perfect gift for graduates!</p> <p>No matter where you are in life, you are not yet all you will be....</p> <p>At some point, virtually everyone finds themselves struggling to find their way in life.</p> <p>Perhaps you're just starting out and haven't yet found your personal or professional path. Maybe you've been plugging away for years, trying to live someone else's dream. Maybe you're outwardly successful but plagued by a nagging, soul-level sense of dissatisfaction.</p> <p>Carly Fiorina, who started as a secretary and later became the first female CEO of a Fortune 50 company, can help. Drawing on her own remarkable journey, and empirical evidence accumulated over four decades in the workplace, Carly will show you how to choose a path over a plan, use problems to propel yourself and your organization forward, overcome fear and procrastination, make smart decisions, and reclaim your power and use it for good.</p> <p>Carly Fiorina believes beyond a shadow of a doubt that your potential can be unleashed. In <i>Find Your Way</i>, she shows you the path to getting there.</p>"; 
